import HomePage from "./pages/HomePage";
import PostPageForm from "./pages/PostPageForm";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/posts/create" element={<PostPageForm />} />
        <Route path="/posts/:id" element={<PostPage />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
